    "favorited" : false,
    "full_text" : "New Odroid XU4Q to replace my raspberry pi 2 as the bootstrapper for the cluster. Shit this thing is so much faster. You can see the backup battery for the rtc right above the Ethernet cable, so it shouldn‚Äôt lose its clock on a reboot, breaking DNSSEC and DNS resolution. https://t.co/0rwts4298e",
