    "created_at" : "Thu Aug 01 04:25:34 +0000 2019",
    "favorited" : false,
    "full_text" : "And I could have gotten a hardware clock module for the Pi, or tried to solve it some other way... but the XU4 has a clock (and the backup battery is cheap), and it‚Äôs faster, so here we are",
    "lang" : "en",
